	this.p_uiselectadd=function(aoz,parent,args)
	{
		this.aoz=aoz;
		this.root=parent.root;
		this.className="procedure";
		this.parent=parent;
		this.vars={};
		this.parent.procParam=0;
		this.parent.procParam$="";
		for ( v in args )
		{
			if ( typeof args[ v ] != "undefined" ) 
				this.vars[ v ] = args[v];
		}
		this.blocks=[];
		this.blocks[0]=function(aoz,vars)
		{
			aoz.sourcePos="0:633:4";
			// Javascript
			var el =  document.getElementById( vars.id$ );
			var index = vars.index;
			if ( index < 0 )
			{
				if ( el.selectedIndex >= 0 )
					index = el.selectedIndex + 1;
				else
					index = el.length;
			}
			var option = document.createElement( 'option' );
			option.text = '' + ( index + 1 ) + ' - ' + vars.options$;
			option.value = '' + index;
			el.add( option, index );
			el.selectedIndex = index;
			el.aozOptionHeight = option.offsetHeight;
			var position = el.scrollTop / el.aozOptionHeight;
			if ( index >= position + el.size )
				el.scrollTop = ( index - el.size + 1 ) * el.aozOptionHeight;
			// End Javascript
			// End Proc
			return{type:0};
		};
	};
